DROP TABLE IF EXISTS environmental_data;

CREATE TABLE environmental_data (
    env_data_id INTEGER,
    recorded_at DATETIME,
    temperature_celsius REAL,
    humidity_percent REAL,
    air_quality_index INTEGER,
    precipitation_mm REAL,
    wind_speed_kmh REAL,
    pressure_hpa REAL,
    location TEXT,
    source TEXT,
    created_at DATETIME
);

